query AssociationReadQuery($resource: AssociationInput!, $withHistory: Boolean) {
  sports_association_read(resource: $resource, with_history: $withHistory) {
    item {
      resource {
        key
        _hashkey
      }
      association {
        code
        name
        region {
          _hashkey
        }
        parent {
          _hashkey
        }
      }
    }
  }
}
